// Bit Manipulation
function matrixScoreBitwise(A: number[][]): number {
  const mask = 2 ** A[0].length - 1;
  const highestBit = A[0].length - 1;
  const scores = A.map((bits) => parseInt(bits.join(''), 2));

  for (let i = 0; i < scores.length; i += 1) {
    if (scores[i] & 1 << highestBit) continue;
    scores[i] = ~scores[i] & mask;
  }

  for (let column = highestBit - 1; column >= 0; column -= 1) {
    const countOnes = scores.reduce((count, score) => count + ((score & (1 << column)) ? 1 : 0), 0)
    if (countOnes > Math.floor(scores.length / 2)) continue;
    for (let i = 0; i < scores.length; i += 1) {
      scores[i] ^= 1 << column;
    }
  }

  return scores.reduce((total, score) => total + score, 0);
};

// Simpler using array manipulation
function matrixScoreArray(A: number[][]): number {
  for (let row = 0; row < A.length; row += 1) {
    if (A[row][0]) continue;
    for (let column = 0; column < A[0].length; column += 1) {
      A[row][column] = A[row][column] ? 0 : 1;
    }
  }

  for (let column = 1; column < A[0].length; column += 1) {
    const countOnes = A.reduce((count, row) => count + row[column], 0)
    if (countOnes > Math.floor(A.length / 2)) continue;
    for (let row = 0; row < A.length; row += 1) {
      A[row][column] = A[row][column] ? 0 : 1;
    }
  }

  return A.reduce((total, row) => total + parseInt(row.join(''), 2), 0);
};

